import container from './../features/container'

function containers(){

	const [container, setContainer] = useState([])
	useEffect(() => {
		retrieveContainers()
	}, [])

	function retrieveContainers(){
		container.getContainer().then(response => { setContainer(response.data) })
	}

	return(
		<>
			{
				console.log(container)
			}
		</>
	)
}
